import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import axios from 'axios'
import { Table } from 'reactstrap'
import 'bootstrap/dist/css/bootstrap.min.css';
import Navbaro from '../src/app'


class App extends React.Component{

  constructor(props){
    super(props)
    this.state={
      items:[],
      flag:'hhhh'
    }
  }


async componentDidMount(){
  await axios.get('https://api.covid19india.org/data.json')
  .then((response)=>{
    console.log(response.data.statewise)
    this.setState({items:response.data.statewise.slice(1,(response.data.statewise).length),flag:'yyy'})})
  .catch((err)=>console.log(err))






  }


render(){

  return(

  <div >
     <Navbaro />
      <Table dark>
      <thead>
        <tr>
          <th>STATES</th>
          <th colspan="2" scope="colgroup">CONFIRMED</th>
          <th >ACTIVE</th>
          <th colspan="2" scope="colgroup">RECOVERED</th>
          <th colspan="2" scope="colgroup">DEATHS</th>

        </tr>
      </thead>

        {this.state.items.map(item=> <tr> 

            <td key={item.id}>{item.state}</td>
            <td style={{color:"yellow"}} key={item.id}>{item.confirmed}</td>
            <td style={{color:"yellow" }}key={item.id}>{item.deltaconfirmed}</td>
            <td style={{color:"#FF0000"}} key={item.id}>{item.active}</td>
            <td style={{color:"#7CFC00"}} key={item.id}>{item.recovered}</td>
            <td style={{color:"#7CFC00"}} key={item.id}>{item.deltarecovered}</td>
            <td key={item.id}>{item.deaths}</td>
            <td key={item.id}>{item.deltadeaths}</td>

           </tr>)}



    </Table>


   </div> 
    )}


}


ReactDOM.render(
  <App />,

  document.getElementById('root')
);


// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
